from collections import deque
def min_cost(graph, start, end): 
    cost = {}
    function = {}
    for i in range(len(graph)):
        for j in range(len(graph[i])): 
            if graph[i][j] > 0: 
                cost[(i,j)] = graph[i][j]
                function[(i,j)] = j
    q = deque([(0, start)])
    while q: 
        (x, y) = q.popleft()
        if (x, y) == (end,): 
            return cost((x,y))
        for i in range(len(graph)): 
            for j in range(len(graph[i])): 
                if graph[i][j] > 0: 
                    temp = cost[i,j] + graph[i][j] * (end, (x, y))
                    if temp < cost[(i, j)): 
                        cost[(i, j)] = temp
                        function[(i, j)] = i
        q.append((x, y))
    return cost, function
